import React from 'react';

function Users(props)  {

        return(
            <>
            <tr>
                <td><b>{props.user}</b></td>
                <td>{props.total}</td>
                <td>{props.storyPoint}</td>
                <td>{props.timeOriginalEstimate}</td>
                <td>{props.timeEstimate}</td>
                <td>{props.timeSpent}</td>
            </tr>
            </>
        )

}

export default Users;
